con:restMockAction.con:dispatchPath:
import groovy.json.JsonSlurper

def requestBody = mockRequest.getRequestContent()

def parsedRequestBody = new JsonSlurper().parseText(requestBody)

def burgerservicenummer = parsedRequestBody.burgerservicenummer[0].toInteger()

if (burgerservicenummer == 555555555) {
    return "200-leeftijd_random"
} else if (burgerservicenummer == 123456789) {
    return "200-leeftijd_change_retry"
} else if (burgerservicenummer == -1) {
    return "205-RESET"
} else {
    return "200-leeftijd_42"
}

con:response.con:script:
import groovy.json.JsonSlurper
//Assuming that you want integer value, otherwise ignore 'as Integer' in below statement
def leeftijd = context.mockService.getPropertyValue('leeftijd') as Integer  

def requestBody = mockRequest.getRequestContent()
def parsedRequestBody = new JsonSlurper().parseText(requestBody)
burgerservicenummer = parsedRequestBody.burgerservicenummer[0].toInteger()
requestContext.burgerservicenummer = burgerservicenummer

Random rand = new Random()

def randomValue = rand.nextInt(100)

while(leeftijd == randomValue) {
	randomValue = rand.nextInt(100)
//	log.info "Random age value: ${randomValue} and ${leeftijd}"
}

// Assign the random value to requestContext.leeftijd
requestContext.leeftijd = randomValue

context.mockService.setPropertyValue('leeftijdRandom', "${randomValue}" )
// You can optionally print or return the random value for debugging
//log.info "Random age value: ${randomValue} and ${leeftijd}"

